import { connect } from 'react-redux'
import Board from '../components/Board'

const mapDispatchToProps = dispatch => {
    return {
        onCardClick: id => {
            console.log(1);
        },
    }
}
const mapStateToProps = state => {
    return {
        cards: state.cards
    }
}
const BoardGame = connect(
    mapStateToProps,
    mapDispatchToProps
)(Board);

export default BoardGame
